import React from 'react'
import FacebookLogo from './../../assets/facebook-logo-white.png'

const LinkFooter = (props) =>
{
    return (
        <div style={{height: 300}} className='bg-mid-gray'>
            <h1>Footer</h1>
            <img src={FacebookLogo} alt='facebook logo' width='32px' height='auto'></img>
        </div>
    );
}

export default LinkFooter;
